//racfp
import React from 'react';
import PropTypes from 'prop-types';
import { connect } from 'react-redux';
import listUsers from '../../reducers/listUsers';

const List = ({ listUsers }) => console.log('List');
//make sure it s not null an make sure there are actually sthg in the array
//cette expression && && if then (je pense)
listUsers !== null &&
  listUsers.length > 0 &&
  listUsers.map((list) => <div>{list.lastname}</div>);

List.propTypes = {
  listUsers: PropTypes.array.isRequired,
};

const mapStateToProps = (state) => ({
  listUsers: state.listUsers,
});

export default connect(mapStateToProps, { listUsers })(List);
